import {Form, Nav, Navbar, NavLink} from "react-bootstrap";
import {Bell, CircleFill, Gear, HouseDoor, SearchHeart} from "react-bootstrap-icons";
import Button from "react-bootstrap/Button";

import React, { Fragment, useState } from 'react';
import { Link, Navigate } from 'react-router-dom';
import { connect } from 'react-redux';
import { logout } from '../actions/auth';

const NavigationBar = ({logout, isAuthenticated}) => {

const [redirect, setRedirect] = useState(false);

const logout_user = () => {
    logout();
    setRedirect(true);
};

const guestLinks = () => (
    <Fragment>
        <li className='nav-item'>
            <Link className='nav-link' to='/login'>Login</Link>
        </li>
        <li className='nav-item'>
            <Link className='nav-link' to='/register'>Register</Link>
        </li>
    </Fragment>
);

const authLinks = () => (
    <Fragment>
        <Form className="d-flex">
            <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
            />
            <Button variant = "dark" ><SearchHeart /></Button>
        </Form>

        <Nav className = "ms-auto">
            <Button size = "lg" variant = "none">
                <NavLink  eventKey="1" as={Link} to="/">
                    <HouseDoor />
                </NavLink>
            </Button>
            <Button size = "lg" variant = "none">
                <NavLink  eventKey="2" as={Link} to="/notifications">
                    <Bell />
                </NavLink>
            </Button>
            <Button size = "lg" variant = "none">
                <NavLink  eventKey="3" as={Link} to="/settings">
                    <Gear />
                </NavLink>
            </Button>
            <Button size = "lg" variant = "none">
                <NavLink  eventKey="4" as={Link} to="/profile">
                    <CircleFill />
                </NavLink>
            </Button>
        </Nav>
    </Fragment>
);
return(
    <Fragment>
        <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
            <Link className='navbar-brand' to='/'>Auth System</Link>
            <button
                className='navbar-toggler'
                type='button'
                data-toggle='collapse'
                data-target='#navbarNav'
                aria-controls='navbarNav'
                aria-expanded='false'
                aria-label='Toggle navigation'
            >
                <span className='navbar-toggler-icon'></span>
            </button>
            <div className='collapse navbar-collapse' id='navbarNav'>
                <ul className='navbar-nav'>
                    <li className='nav-item active'>
                        <Link className='nav-link' to='/'>Home <span className='sr-only'>(current)</span></Link>
                    </li>
                    {isAuthenticated ? authLinks() : guestLinks()}
                </ul>
            </div>
        </nav>
        {redirect ? <Navigate to='/' /> : <Fragment></Fragment>}
    </Fragment>
);
};

const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated
});

export default connect(mapStateToProps, { logout })(NavigationBar);
